void draw_horizontal_line(int x1, int x2, int y, short int color){
    for (int x = x1; x <= x2; ++x){
        plot_pixel(x, y, color);
    }
}

void draw_vertical_line(int x, int y1, int y2, short int color) {
    for (int y = y1; y <= y2; ++y) {
        plot_pixel(x, y, color);
    }
}

void draw_line(int y, int middle_point, int gap_width, short int line_color){

    for (int x = 0; x < middle_point - gap_width/2; ++x){
        plot_pixel(x, y, line_color);
    }
    for (int x = middle_point + gap_width/2; x < 320; ++x){
        plot_pixel(x, y, line_color);
    }

}

void plot_pixel(int x, int y, short int line_color)
{
    *(short int *)(pixel_buffer_start + (y << 10) + (x << 1)) = line_color;
}
